/*! CSS Used from: https://golang.org/lib/godoc/style.css */
body{background-color:rgb(255, 255, 255);color:rgb(62, 64, 66);font-family:Roboto, Arial, sans-serif;line-height:1.3;margin:0px;text-align:center;}
.Site{display:flex;flex-direction:column;min-height:100vh;}
::-webkit-input-placeholder{color:rgb(127, 127, 127);opacity:1;}
::placeholder{color:rgb(127, 127, 127);opacity:1;}
@media (max-width: 43.75em){
body{font-size:0.9375rem;}
}
